import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Parse from 'parse';

const Dashboard = () => {
  const navigate = useNavigate();
  const currentUser = Parse.User.current();

  // လက်ရှိကြည့်နေတဲ့ Video လင့်ကို သိမ်းဖို့
  const [activeVideo, setActiveVideo] = useState("https://www.youtube.com/embed/dQw4w9WgXcQ"); // ဥပမာ Video

  const lessons = [
    { id: 1, title: "1. Introduction to Linux", url: "https://www.youtube.com/embed/v_PjgYVv6Lg" },
    { id: 2, title: "2. Basic Command Line", url: "https://www.youtube.com/embed/wbpIfX-C8EY" },
    { id: 3, title: "3. User Permissions", url: "https://www.youtube.com/embed/e_itI-C8pLw" },
  ];

  const handleLogout = async () => {
    await Parse.User.logOut();
    navigate('/login');
  };

  if (!currentUser) {
    return <div style={{color: 'red', textAlign: 'center', marginTop: '50px'}}>Access Denied!</div>;
  }

  return (
    <div style={{ backgroundColor: '#0a192f', minHeight: '100vh', color: '#ccd6f6' }}>
      {/* Top Nav */}
      <nav style={styles.nav}>
        <h2 style={{ color: '#00ff41' }}>CS_SCHOOL DASHBOARD</h2>
        <div style={{ display: 'flex', alignItems: 'center', gap: '20px' }}>
          <span>Agent: <span style={{color: '#00ff41'}}>{currentUser.get('username')}</span></span>
          <button onClick={handleLogout} style={styles.logoutBtn}>LOGOUT</button>
        </div>
      </nav>

      <div style={styles.mainGrid}>
        {/* Left Side: Video Player */}
        <div style={styles.videoContainer}>
          <iframe 
            width="100%" height="450px" 
            src={activeVideo} title="Lesson Video" 
            frameBorder="0" allowFullScreen 
            style={{ borderRadius: '10px', border: '1px solid #233554' }}
          ></iframe>
          <div style={{ marginTop: '20px' }}>
            <h2 style={{ color: '#00ff41' }}>Currently Studying...</h2>
            <p>သင်ခန်းစာများကို အစဉ်လိုက်လေ့လာပြီး လက်တွေ့စမ်းသပ်ကြည့်ပါ။</p>
          </div>
        </div>

        {/* Right Side: Lesson List */}
        <div style={styles.lessonList}>
          <h3 style={{ borderBottom: '1px solid #233554', paddingBottom: '10px' }}>Course Content</h3>
          {lessons.map((lesson) => (
            <div 
              key={lesson.id} 
              onClick={() => setActiveVideo(lesson.url)}
              style={{
                ...styles.lessonItem,
                backgroundColor: activeVideo === lesson.url ? '#112240' : 'transparent',
                borderColor: activeVideo === lesson.url ? '#00ff41' : '#233554'
              }}
            >
              <span>{lesson.title}</span>
              <span style={{ fontSize: '12px', color: '#00ff41' }}>{activeVideo === lesson.url ? "▶ Playing" : "Locked"}</span>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

const styles = {
  nav: { display: 'flex', justifyContent: 'space-between', padding: '15px 5%', background: '#112240', alignItems: 'center', borderBottom: '2px solid #00ff41' },
  logoutBtn: { background: 'transparent', color: '#ff4b2b', border: '1px solid #ff4b2b', padding: '5px 15px', borderRadius: '5px', cursor: 'pointer' },
  mainGrid: { display: 'grid', gridTemplateColumns: '2fr 1fr', gap: '30px', padding: '30px 5%', flexWrap: 'wrap' },
  videoContainer: { background: '#112240', padding: '20px', borderRadius: '15px' },
  lessonList: { background: '#112240', padding: '20px', borderRadius: '15px', height: 'fit-content' },
  lessonItem: { padding: '15px', border: '1px solid', borderRadius: '8px', marginBottom: '10px', cursor: 'pointer', display: 'flex', justifyContent: 'space-between', alignItems: 'center', transition: '0.3s' }
};

export default Dashboard;
